-- ----------------------------
-- Table structure for goods
-- ----------------------------
DROP TABLE IF EXISTS `goods`;
CREATE TABLE `goods`  (
  `Id` int(0) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `imgUrl` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品图片地址',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品描述',
  `price` float(10, 2) NULL DEFAULT NULL COMMENT '商品价格',
  `type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品类型',
  `status` int(0) NULL DEFAULT NULL COMMENT '0 代表商品处在正常情况中 1 代表商品正在交易 2 代表商品被商家冻结 3 代表商品已经被下架了',
  `supply_id` int(0) NULL DEFAULT NULL COMMENT '提供者id',
  `supply_time` datetime(0) NULL DEFAULT NULL COMMENT '上架时间',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

