-- Table structure for order_update
-- ----------------------------
DROP TABLE IF EXISTS `order_update`;
CREATE TABLE `order_update`  (
  `id` int(0) NOT NULL COMMENT '交易表中的编号',
  `trade_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交易时间',
  `trade_place` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交易地点',
  `name` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户姓名',
